SELECT account_no,customer,lp_description,lp_from_range,lp_to_range,lp_src_realm,lp_nextrealm_list,lp_nexthop_list,lp_active,"chargeTypes"
FROM public.gen1_ntwk_data 
WHERE lp_src_realm ILIKE '%telstra%' AND (lp_src_realm ILIKE '%byoc%' OR lp_src_realm ILIKE '%agl%' OR lp_src_realm ILIKE '%allianzins%' OR lp_src_realm ILIKE 'ttec%') AND lp_nexthop_list NOT ILIKE 'drain' ;
